INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1057501040, "", 11, 0, 6, 105711, 1, 1, 1057501, 0, "お祝いしてくれてありがとう！\n私の誕生日、覚えててくれたんだね。\nすごくうれしいな。");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1057501041, "", 91, "", "", 0, "", "", 1057501, "", "");
