INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1070501040, "", 11, 0, 4, 107011, 1, 1, 1070501, 0, "ふむ、よい趣向ですね。\n敬うべき相手を忘れず、恩を忘れず、\n健勝を祝う宴を開く……\n礼節を弁えた人間は好きですよ。");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1070501041, "", 91, "", "", 0, "", "", 1070501, "", "");
