INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1110501040, "", 11, 0, 5, 111011, 1, 1, 1110501, 0, "ほわあああぁぁ何この蝋燭！？\n思わず知的興奮で吹き消してしまったが\n怪しい残り香、興味深ぁ～！\n鼻腔から学び入ってくる～！");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1110501041, "", 91, "", "", 0, "", "", 1110501, "", "");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1110501042, "", 21, "", 0, "vo_adv_1110501", 0, "", 1110501, "", "vo_adv_1110501_001");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1110501043, "", 11, 0, 4, 111011, 1, 1, 1110501, 0, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1110501044, "", 91, "", "", 0, "", "", 1110501, "", "");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1110501045, "", 21, "", 0, "vo_adv_1110501", 0, "", 1110501, "", "vo_adv_1110501_002");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1110501046, "", 11, 0, 4, 111011, 1, 1, 1110501, 0, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1110501047, "", 91, "", "", 0, "", "", 1110501, "", "");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1110501048, "", 21, "", 0, "vo_adv_1110501", 0, "", 1110501, "", "vo_adv_1110501_003");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1110501049, "", 11, 0, 5, 111011, 1, 1, 1110501, 0, "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！");
